.
Acontece que, como quase todas as funções do corpo são mediadas por hormônios, existem inúmeras situações em que esses profissionais podem ser requisitados.
.
Das alterações no odor do suor, passando pela perda ou ganho de peso, alterações menstruais até a terapia hormonal para redesignação sexual: tudo isso pode ser abordado com qualidade por um bom especialista em endocrinologia.
.
Algumas das doenças tratadas por esse especialista são doenças na tireoide, diabetes, obesidade, síndrome dos ovários micropolicísticos, osteoporose, doenças suprarrenais, entre outras.
.
A disfunção hormonal pode envolver qualquer parte do organismo ou até mesmo ele todo. Por isso, é um problema muito grave, pois algumas doenças acarretadas por ela são perigosas e podem provocar a perda de mobilidade e funções do corpo, além de levarem à morte.
.
Você deverá procurar um endocrinologista sempre que houver algum problema relacionado ao metabolismo do seu corpo, ganho ou perda de peso rápidos e sem causa aparente, problemas de crescimento ou quando houver diagnóstico de doenças como diabetes e alterações nos níveis de colesterol ou triglicérides.
.
O acompanhamento e tratamento junto a esse especialista proporcionarão uma melhor qualidade de vida para quem sofre com o problema.
.
Dr Willian Cassuriaga Aymone
Médico, especialista em Medicina interna e Endocrinologia e Metabologia.
